window.bookSummaryJSON = "<p>The last wing of the red cathedral is finally live, and the possibility king awaits. To reach his throne, players will have to face foes capable of bringing about the end of the world. However, nothing can compare to their creator.<br> <br> The prize for defeating him is unprecedented: the ability to create a custom Ripple. A single change that will alter the very fabric of EBO forever. A power that Ned’s enemies would do anything to obtain.<br> <br> As the frantic race for Frank’s chair heats up, old enemies are on the warpath and desperate choices must be made. This time, no one will make it out unscathed.<br> <br> There will be much blood, but more than the previous iterations. Five times more maybe?<br> <br> Even more cats, too.</p>"; 
